import React from "react";

function Card({ user }) {
  return (
    <tbody>
      <tr className="border">
        <td className="border p-2">{user.name}</td>
        <td className="border p-2">{user.occupation}</td>
        <td className="border p-2">{user.email}</td>
        <td className="border p-2">{user.bio}</td>
      </tr>
    </tbody>
  );
}

export default Card;
